    class TestReader : IEmitReader
    {
        public event EventHandler<EmitDataRecievedEventArgs> DataReceived;
        public Queue<EmitData> testData = new Queue<EmitData>();

        protected int Tempo { get; set; }

        public TestReader(int tempo)
        {
            this.Tempo = tempo;
        }

        public void Start()
        {
            loadTestData();
            EventHandler<EmitDataRecievedEventArgs> handler = DataReceived;

            // emulate race at speed
            DateTime start = testData.Peek().Time;

            while (testData.Count > 0)
            {
                while (testData.Count > 0 && testData.Peek().Time <= start)
                {
                    EmitData d = testData.Dequeue();
                    d.Time = d.Time.AddHours(13).AddMinutes(14);
                    d.Id -= 500;

                    if (handler != null)
                        handler(this, new EmitDataRecievedEventArgs(d));
                    
                }
                start = start.AddSeconds(1);
                System.Threading.Thread.Sleep(Tempo);
            }
        }

        public void Stop()
        {
        }

